import "./Main.css";

function Main() {
  return (
    <main className="main-container">
      <div className="card">
        <h1>Привіт, це мій React проєкт!</h1>
        <p>Я вчуся створювати компоненти та стилізувати їх окремо.</p>
        <button className="action-button">Дізнатися більше</button>
      </div>
    </main>
  );
}

export default Main;
